import React from 'react';
import Infobox from '../Components/Infobox';
import Vents from '../Components/Vent';
import Dail from '../Components/Dial';
import ControlButtons from '../Components/ControlButton';
import lighteningBolt from '../Icons/LighteningBolt/Vector 2@2x.png'

const FAKE_TITLE= 'Title'
const FAKE_DESCRIPTION= 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Convallis convallis tellus id interdum.'
const FAKE_IMAGE= lighteningBolt
type TitleBoxProps = {
    SectionTitle: string;
};

const TitleDesign = {
    color: '#122701',
    fontFamily: 'Inter',
    fontSize: '8px',
    fontStyle: 'normal',
    fontWeight: 600,
    lineHeight: '9px',

};

function TitleBox({ SectionTitle }: TitleBoxProps) {
    const uppercasedTitle = SectionTitle.toUpperCase();
    return (
        <div>
            <h1 style={TitleDesign}>
                {uppercasedTitle}
            </h1>
        </div>
    );
}


function Main() {
    return (
        <>
            <div className='Info-area'>
                <Infobox Title={FAKE_TITLE} Description={FAKE_DESCRIPTION}  />
                <Infobox Title={FAKE_TITLE} Description={FAKE_DESCRIPTION} Image={FAKE_IMAGE}/>
            </div>
            <TitleBox SectionTitle='Vents' />
            <Vents/>
            <TitleBox SectionTitle='Temps' />
            <Dail/>
            <TitleBox SectionTitle='Controls' />
            <div className='control-button-area'>
                <ControlButtons />
                <ControlButtons />
                <ControlButtons />
                <ControlButtons />
            </div>

        </>
    );
}

export default Main;
